INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007404043, 0, "ふふ、相変わらず敏い子ね。\nそういうところ、家系なのかしら。\nああ、そういえば偏屈ジジイ……\nこほん、ユニークなお爺様たちは元気？", 117531, 1, 11, 1007404, 5);
