INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007404050, 0, "さてな。\n存知のように、ぼくも今は都暮らしだ。\n里の連中とはしばらく会っとらんが、\nまあ、向こう百年はくたばらんだろう。", 111011, 1, 11, 1007404, 5);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007404051, "", 0, 0, "", 91, 1007404, "");
