INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007404059, "", "vo_mhp_1008", "vo_mhp_1007404", 0, 21, 1007404, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007404060, 0, "その節は身内が申し訳ない。\n彼らは都の有識者──ことに理系の者を\n蛇蝎のごとく敵視しているのだ。", 111011, 1, 11, 1007404, 5);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007404061, "", 0, 0, "", 91, 1007404, "");
