INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007404064, 0, "やれやれ、嘆かわしい老人たちめ。\n学問に貴賤なし──\nぼくらはみな等しく学びの信徒だ、\n文系だ理系だと諍うことの愚かしさよ。", 111011, 1, 11, 1007404, 4);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007404065, "", 0, 0, "", 91, 1007404, "");
