INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007404069, 0, "そうね、うん、ところでユニちゃん。\nちょっと込み入ったことを聞くけれど、\n里からの仕送りは足りてるのかしら。", 117531, 1, 11, 1007404, 6);
