INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007407045, 0, "ええと、スズメさんね。\n今日はどうされました？\n転倒して足を痛めた、とかかしら？", 117531, 1, 11, 1007407, 6);
