INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007410028, 0, "あら、これはまた\n只者じゃない人が来たわね。", 117531, 1, 11, 1007410, 6);
