INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410032, "", "vo_mhp_5003", "vo_mhp_1007410", 0, 21, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (1.5, 0, 0, 1007410033, 0, "ほう、分かるか？　いかにも！\n我が名はイリヤ・オーンスタイン\n夜を総べる者であるぞ！", 104431, 1, 11, 1007410, 4);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410034, "", "", 0, "", 91, 1007410, "");
