INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410042, "", "vo_mhp_5005", "vo_mhp_1007410", 0, 21, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007410043, 0, "さすが名医、理解が早くて助かる……\nって、ど、どうした？　なんだか\n興奮しておるようじゃが……", 104431, 1, 11, 1007410, 5);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410044, "", 1, 5, "", 93, 1007410, "");
