INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410049, "", "vo_mhp_5006", "vo_mhp_1007410", 0, 21, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007410050, 0, "当然よ。だって伝説の吸血鬼でしょ？\nこんな魅力的な研究対象を前にすれば\n誰だって興奮するわ。だから――", 117531, 1, 11, 1007410, 5);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410051, "", "", 0, "", 91, 1007410, "");
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410052, "", 1007410055, "その体、解剖させてくれない？", "", 103, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410053, "", 1007410066, "私の血を吸ってみる？", "", 103, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410054, "", 1007410072, "私の目、使っちゃおうかしら？", "", 103, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", 0.2, 1007410055, "", "mhp_mitsuki_sit_ecstatic_idle", 117531, "", 3, 1007410, 1);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", 0.2, 1007410056, "", "mhp_sit_talk_surprise2", 104431, "", 3, 1007410, 1);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410057, "", "vo_mhp_5007", "vo_mhp_1007410", 0, 21, 1007410, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007410058, 0, "怖い怖い！　急に何を言い出すんじゃ！\nいいわけないじゃろ！", 104431, 1, 11, 1007410, 6);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007410059, "", "", 0, "", 91, 1007410, "");
