INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007413046, 0, "あん、し……え、何？", 117631, 1, 11, 1007413, 5);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413047, "", "", 0, "", 91, 1007413, "");
