INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007413051, 0, "あなたも色々大変ね\nそれで、具体的にどんな症状が\n出てるのかしら？", 117531, 1, 11, 1007413, 6);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413052, "", "", 0, "", 91, 1007413, "");
