INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007413057, 0, "うむ、実はひどい頭痛に\n見舞われていてな……", 100931, 1, 11, 1007413, 6);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413058, "", "", 0, "", 91, 1007413, "");
