INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007413062, 0, "それはいけないわ。\nさっそく手術をはじめましょう。\nスパっとパカーンとやるわね。", 117531, 1, 11, 1007413, 6);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413063, "", "", 0, "", 91, 1007413, "");
