INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES (0.5, 0, 0, 1007413067, 0, "え！？　手術！？\nい、いや……そこまでするのは\nいささか早計では？", 100931, 1, 11, 1007413, 6);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413068, "", "", 0, "", 91, 1007413, "");
