INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413075, "", 1007413078, "トーゴクの霊薬、カンポーを処方するわ。", "", 103, 1007413, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413076, "", 1007413127, "頭痛に効くツボを押すわね。", "", 103, 1007413, 0);
INSERT INTO `v1_af4fdff43daedc28e796303f3098f07466274dc224369ea910b8b118f9c3fbce` VALUES ("", "", "", 1007413077, "", 1007413158, "頭痛薬を出しておくわ。", "", 103, 1007413, 0);
